description:
The show is set in modern-day Australia and focuses on the fictional women's prison Wentworth. The central characters in the prison are inmates Bea Smith (Danielle Cormack), Franky Doyle (Nicole da Silva), Doreen Anderson (Shareena Clanton), Liz Birdsworth (Celia Ireland), Jacs Holt (Kris McQuade) and and prison officers Vera Bennett (Kate Atkinson), Matthew Fletcher (Aaron Jeffery), Will Jackson (Robbie Magasiva), Erica Davidson (Leeanna Walsman) and Meg Jackson (Catherine McClements).
The season received generally favourable reviews from critics. The first episode of Wentworth attracted 244,000 viewers, making it the most watched Australian drama series premiere in Foxtel history.
